webpackJsonp([36513862591865],{6700:function(e,t){e.exports={data:{post:{html:'<p>Sunday is election day in Hamburg. If you believe the NDR, <a title="NDR Online: Infratest dimap Umfrage vom 18.02.2004 - Kopf-an-Kopf-Rennen zwischen CDU und Rot-Grün" href="http://www.ndr.de/ndr/regional/hh/wahl/umfrage/20040218/index.html">the race is neck and neck</a>. If you believe the Springer press, <a title="Umfrage: CDU legt zu, SPD verliert" href="http://www.abendblatt.de/daten/2004/02/21/264972.html">the CDU has a clear lead</a>. Mayor Beust has <a title="NDR Online: Bürgerschaftswahl Hamburg 2004 - Kreuzverhör statt TV-Duell: Von Beust gegen Mirow" href="http://www.ndr.de/ndr/regional/hh/wahl/20040223/beust_absage.html">cancelled a TV debate</a> with SPD candidate Mirow scheduled for this evening. Spiegel Online thinks Mirow\'s Kindergarten poster <a title="Hamburgs Bürgermeisteranwärter Mirow: Lehrling ohne Zauber - Politik - SPIEGEL ONLINE" href="http://www.spiegel.de/politik/deutschland/0,1518,286799,00.html">made him look silly</a>. And the best information on the election can be found at <a title="Wahl in Hamburg - Hamburger Wahlblog" href="http://interferno.org/wahlinhamburg/">Hamburger Wahlblog</a>.</p>',fields:{title:"Who Should You Believe?",date:"25 Feb 2004",url:"https://papascott.de/2004-02-25-who-should-you-believe/"}}},pathContext:{slug:"/2004-02-25-who-should-you-believe/",prev:{fields:{title:"BBC: Swiss hunt air controller's killer",date:"25 Feb 2004",slug:"/2004-02-25-bbc-swiss-hunt-air-controllers-killer/"}},next:{fields:{title:"www.schwule-fuer-ole.com",date:"25 Feb 2004",slug:"/2004-02-25-wwwschwule-fuer-olecom/"}}}}}});
